import styled from 'styled-components';

const QuestionItemCard = styled.div`
    margin-top: 20px;
    margin-bottom: 20px;
    background-color: green;
`;

const QuestionItemTitle = styled.div`
    font-size: 27px;
    font-weight: bold;
`;

const QuestionItemSelectBox = styled.div`
    display: flex;
`;

const F = styled.form`
    margin-right: 20px;
`;

export default function QuestionItem(props) {
    return (
      <>
        <QuestionItemCard>
            <QuestionItemTitle>{props.title}</QuestionItemTitle>
            <QuestionItemSelectBox>
                <F>
                    <input type='radio' name='check1' value='1'></input>1
                    <input type='radio' name='check1' value='2'></input>2
                    <input type='radio' name='check1' value='3'></input>3
                    <input type='radio' name='check1' value='4'></input>4
                    <input type='radio' name='check1' value='5'></input>5
                </F>
            </QuestionItemSelectBox>
        </QuestionItemCard>
      </>
    );
}
